<script>
import anime from "animejs/lib/anime.es.js";
import {ref} from "vue";

export default {
    methods: {},
    mounted() {
        let _this = this
        $(document)
            .on('mousemove mouseenter touchmove', '#dz_map_con', function (e) {

                let clientX = e.type === 'touchmove' ? e.touches[0].clientX : e.clientX
                let clientY = e.type === 'touchmove' ? e.touches[0].clientY : e.clientY
                let x = clientX - $(this).offset().left
                let y = clientY - $(this).offset().top
                let s = y > _this.subP($(this).height(), 70) ? 2 : _this.scale
                $(this).find('svg').css({
                    'transform-origin': `${x}px ${y}px `,
                    'scale': `${s}`
                })
            })
            .on('mouseleave ', '#dz_map_con', function (e) {
                let x = 0
                let y = 0
                $(this).find('svg').css({
                    'transform-origin': `${x}px ${y}px `,
                    'scale': '1'
                })
            })
            .on('mousedown', '.cls-1', function (e) {

                _this.$emit('hoverStates', {state: $(this).attr('id')})
            })
            .on('mouseover', '.cls-1', function (e) {
                let g = $(this)
                this.state_selected = g.attr('id')
                anime({
                    targets: g[0],
                    fill: '#721db8',
                    opacity: 1,
                    easing: 'easeInQuad',
                    duration: 200,
                })
                $('#dz_map g').append(g.parent())

            })
            .on('mouseleave touchend', '.cls-1', function (e) {
                let g = $(this)
                anime({
                    targets: g[0],
                    fill: '#1d71b8',
                    easing: 'easeInQuad',
                    duration: 200,
                })
            })
    },
    setup() {
        const scale = 5;
        const state_selected = ref('')
        const subP = (num, sub) => {
            return num - (num * sub) / 100;
        }

        const dataSVG = {
            cords: {
                mX: '0',
                mY: '0',
                w: '676.6',
                h: '677.28'
            }
        }
        const dataSVGZoom = {
            cords: {
                mX: 0 - 50,
                mY: 0 - 50,
                w: 458 + 100,
                h: 446 + 100,
            }
        }
        return {
            dataSVGZoom,
            scale,
            subP,
            state_selected
        }
    }
}

</script>

